import './Msg.css'


class Msg extends React.Component{

    render(){
        return(
            <div className="containerMsg">
                <span className="mensagem" ondblclick="" >{this.props.nome}</span>
                <span>{this.props.mensagem}</span>
            </div>
        )
    }

}

export default Msg
